using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Задача_13
{
    class Program
    {
        static void Main(string[] args)
        {
            int res = 0;
            string str = "";
            string b = Console.ReadLine();
            if (b.Length != 1) { Console.WriteLine("Нужно ввести ровно один символ");return; }
            int i = 0;
            res = str.IndexOf(b);
            while (i < str.Length)
            {
                Console.Write(res + " ");
                res = str.IndexOf(b, res + 1);
                if (res == -1) { break; }
                i++;
            }
        }
    }
}
